var b="url",c="مشخصات.html",d="generationDate",e=new Date(1754216627486.14),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="43320f15f87345348fd476a57c77d221",w="type",x="Axure:Page",y="مشخصات",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="c9fcd4f0a7c34c66b478ccbb3d6a5917",F="label",G="Note",H="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه کارجو در سامانه فرصت های شغلی پس از احراز هویت مرحله ثبت نام را انجام داده باشد و دارای یک پروفایل باشد و رزومه ای&nbsp; از وی توسط مدیر جذب و استخدام به &quot;وضعیت&quot; تایید رفته باشد هنگام ثبت نام تکمیلی در سامانه جذب و استخدام فیلدهای</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">کد ملی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">شماره تلفن همراه</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">نام</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">نام خانوادگی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">جنسیت</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">تاریخ تولد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">وضعیت نظام وظیفه</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">سابقه کاری</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">مقطع تحصیلی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">رشته تحصیلی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">مهارت/نرم افزارها</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">رزومه بارگذاری شده(در صورت بارگذاری)</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">و فرصت شغلی که کارجو در سامانه فرصت های شغلی برای آن رزومه ارسال نموده است و رزومه ارسال شده نیز توسط مدیر جذب و استخدام به وضعیت &quot;تایید&quot; رفته است</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">از اطلاعات کارجو در سامانه فرصت های شغلی واکشی و در فرم ثبت نام تکمیلی در سامانه جذب و استخدام درج و نمایش داده شود</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">توجه گردد در صورت واکشی اطلاعات از پروفایل کارجو، فیلدهای</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">فرصت شغلی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&nbsp;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">کد ملی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">&nbsp;شماره تلفن همراه</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">&nbsp;نام، نام خانوادگی</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">&nbsp;و جنسیت</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"> </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در این فرم(ثبت نام تکمیلی) غیر قابل ویرایش باشد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">*************************************</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">تا زمانی که کارجو در سامانه جذب و استخدام مرحله ضمیمه مدارک را انجام نداده باشد همگام سازی فیلدهای فوق در دو سامانه جذب و استخدام و سامانه فرصت های شغلی انجام</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">&nbsp;پذیرد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">(Synchronize)</span></p>",I="2",J="03ad5527852a46bf9d211088d02826a0",K="(Droplist)",L="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که جنسیت خانم وارد گردیده باشد فیلد وضعیت نظام وظیفه(ویژه آقایان) غیر فعال گردد و نیازی به وارد نمودن دیتا در این فیلد برای جنسیت خانم نباشد.اما در صورتی که جنسیت آقا وارد گردیده باشد ورود این فیلد برای آقایان اجباری باشد</span></p>",M="3",N="c7a3622f2eb54887b1bd611f06a8f6bd",O="(Text Field)",P="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که وضعیت نظام پزشکی از نوع معافیت پزشکی وارد شده باشد ورود علت معافیت پزشکی اجباری گردد</span></p>",Q="4",R="9616b37a7bd24209bdfcdb953b4abcf5",S="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#000080;\">فرصت شغلی که کارجو با مشاهده آگهی استخدام مربوط به آن&nbsp; بر روی آن رزومه ارسال نموده و رزومه ارسال شده بر روی این فرصت شغلی نیز توسط مدیر جذب و استخدام به وضعیت &quot;تایید&quot; رفته است واکشی و در این فیلد نمایش داده شود</span></p>",T="5",U="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">پیشنهاد می گردد </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">جهت </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#8400FF;\">حفظ پایداری </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">فرایند فرصت های شغلی، ثبت نام تکمیلی کارجو تنها پس از آنکه رزومه کارجو بر روی یک فرصت شغلی توسط مدیر جذب و استخدام به وضعیت &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#4B7902;\">تایید</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; رفت فراهم باشد و تا قبل از آنکه رزومه ای از کارجو&nbsp; توسط مدیر جذب و استخدام به وضعیت &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#4B7902;\">تایید</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; نرفته است امکان ثبت نام </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">تکمیلی کارجو وجود </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A30014;\">نداشته </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">باشد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">جهت مدیریت امکان ورود یا عدم ورود کارجو جهت ثبت نام تکمیلی، می توان بر روی تایید رزومه کارجو توسط مدیر جذب و استخدام شرطی قرار داد تا امکان ورود&nbsp; یا عدم ورود کارجو جهت ثبت نام تکمیلی وجود داشته باشد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">:شرط</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">if </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">(</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#6300BF;\">رزومه ای از کارجو در وضعیت تایید قرار دارد</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">)</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">then</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&nbsp;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#4B7902;\">امکان ورود کارجو جهت ثبت نام تکمیلی وجود داشته باشد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">else</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">امکان ثبت نام تکمیلی جهت ورود وجود نداشته باشد</span></p>",V="style",W="baseStyle",X="627587b6038d43cca051c114ac41ad32",Y="pageAlignment",Z="center",ba="fill",bb="fillType",bc="solid",bd="color",be=0xFFFFFFFF,bf="image",bg="imageAlignment",bh="near",bi="imageRepeat",bj="auto",bk="favicon",bl="sketchFactor",bm="0",bn="colorStyle",b